import React from "react";
import { SkeletonPage, TextContainer, TextField, Button, Modal } from "@shopify/polaris";

function SnippetGen(props) {
  return (
    <div>
      <Modal
        open={props.active}
        onClose={props.handleChange}
        title={props.title}
        primaryAction={{
          content: "Add Instagram",
          onAction: props.handleChange
        }}
      >
        <Modal.Section>
          <TextContainer>
            <TextField multiline value={props.value}></TextField>
          </TextContainer>
        </Modal.Section>
      </Modal>
    </div>
  );
}

export default SnippetGen;
